import { css } from "aphrodite/no-important"
import styles from './styles'
import { FormikControl } from "../../../Components"

export const SearchPresent = () => {
  return <div className={ css(styles.wrapper) }>
    <FormikControl control='input' id='title' type='text' label='Пошук на Google Картах' />

    { data.length !== 0 ? <select className={ css(styles.select) } size={ data.length } id='description' name='description' onChange={ handleChange } onBlur={ handleBlur }>
      { status === 'OK' && data.map((value, index) => {
        return <option className={ css(styles.option) } key={index} value={value.description}>{value.description}</option>
      }) }
    </select> : null }
  </div>
}
